export default app=>{app.component("carousel-item",{props:["imgsrc","imgalt","title","text","interval","active"],template:`<div class="carousel-item" :class="{ active: active }" :data-bs-interval="interval">\n        <img :src="imgsrc" class="d-block w-100" :alt="imgalt">\n        <figcaption class="carousel-caption d-none d-md-block">\n            <h5>{{ title }}</h5>\n            <p><slot name="text">{{ text }}</slot></p>\n        </figcaption>\n    </div>`})};